import React from 'react';
import { Container, Grid, Drawer, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { Home, Inbox, Mail } from '@mui/icons-material';

const App = () => {
  const pageStyles = {
    backgroundColor: '#111115',
    minHeight: '100vh',
  };

  const sidebarStyles = {
    backgroundColor: 'white', // Individual sidebar background color
    width: '240px',
    padding: '16px',
  };

  const listItemStyles = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '12px',
  };

  return (
    <div style={pageStyles}>
      <Container>
        <Grid container>
        <Grid item xs={3}>

          </Grid>
          <Grid item xs={3}>
          <Drawer variant="permanent" sx={sidebarStyles}>

              <List>
                <ListItem button sx={listItemStyles}>
                  <ListItemIcon>
                    <Home />
                  </ListItemIcon>
                  <ListItemText primary="Home" />
                </ListItem>
                <ListItem button sx={listItemStyles}>
                  <ListItemIcon>
                    <Inbox />
                  </ListItemIcon>
                  <ListItemText primary="Inbox" />
                </ListItem>
                <ListItem button sx={listItemStyles}>
                  <ListItemIcon>
                    <Mail />
                  </ListItemIcon>
                  <ListItemText primary="Mail" />
                </ListItem>
              </List>
            </Drawer>
          </Grid>

          <Grid item xs={6}>
            {/* Main content */}
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
